function process_input() {
  const { module, positionals, keywords } = $input.first().json
  const make_interpretable = (str) => JSON.stringify(str.replace(/[\r\n\t']/g, "").replace(/&amp;/g, "%26")).replace(/\\"/g, '^')
  const process_command = () => module.includes("python") ? module : `python -m ${module}`
  const process_arguments = ()  => positionals.length ? [...positionals.map(x => make_interpretable(x))] : []
  const format_flag = (str) => str.startsWith('-') ? str : str.length === 1 ? `-${str}` : `--${str}`
  const process_options = () => Object.entries(keywords).map(
    ([flag, value]) => `${format_flag(flag)} ${make_interpretable(value)}`
  )
  return [
    process_command(), 
    ...process_options(), 
    ...process_arguments()
  ].join(' ')
}

return { command: process_input() }

const { stderr, stdout, exitCode } = $input.first().json

const try_parse = (s) => {
  try {
    const json = JSON.parse(s)

    if ('text' in json && typeof json.text === 'string') {
      const [first, ...rest] = json.text.split("\n")
      const [, entry] = first.split(/\ \w+\.\w+\:\w+\:\d+\ \-\ /g)
      json.text = [entry, ...rest].filter(Boolean)
    } 

    if ('record' in json && typeof json.record === 'object') {
      const { elapsed, exception, extra, process, time } = json.record
      json.record = { elapsed, exception, extra, process, time }
    }

    return json

  } catch {
    if (typeof s === 'object') return s
    if (typeof s === 'string') return { text: s, record: {} }    
  }
}

return {
  code: exitCode,
  output: try_parse(stdout),
  error: try_parse(stderr),
}
